import logo from './logo.svg';
import './App.css';
import {useState} from 'react'; 
import {Routes, Route, Link, useNavigate} from 'react-router-dom';
import data from './data';
import data2 from './data2';
import data3 from './data3';
import data4 from './data4';
import chiefdata from './chiefdata';
import MainShowCase from './component/MainShowCase';
import Detail from './component/Detail';
import Cart from './component/Cart';
import Footer from './component/Footer';
import { useEffect } from 'react';



function App() {
  useEffect(()=>{
    if(localStorage.getItem('watched') == null){
      localStorage.setItem('watched', JSON.stringify([ ]))
    }
  },[]);

  let [pang, setPang] = useState(data);
  let [pang2,setPang2] = useState(data2);
  let [pang3,setPann3] = useState(data3);
  let [pang4,setPang4] = useState(data4);
  let [chief,setChief] = useState(chiefdata);
  let navigate = useNavigate();

  const scrollToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: 'smooth'
  })}

  return (
    <div>
      <div className="quick">
        <img className="sign" src={process.env.PUBLIC_URL + "/call.png"} />
      </div>
      <div
        className="quick2"
        onClick={() => {
          scrollToTop();
          navigate("/cart");
        }}
      >
        <img
          className="sign2"
          src={process.env.PUBLIC_URL + "/shopping-bag.png"}
        />
      </div>
      <div className="navContainer">
        <div className="innerNav">
          <p
            className="home"
            onClick={() => {
              navigate("/");
            }}
          >
            Un Bouquet De Lavande
          </p>
          <ul>
            <li>로그인</li>
            <Link className="menuList" to="/cart">
              <li>장바구니</li>
            </Link>
          </ul>
          <div className="iconArea">
            <img
              className="logIn"
              src={process.env.PUBLIC_URL + "/avatar.png"}
            />
            <Link to="/cart">
              <img
                className="cartIcon"
                src={process.env.PUBLIC_URL + "/cart.png"}
              />
            </Link>
          </div>
        </div>
      </div>
      <div className="main-bg"></div>
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <MainShowCase
                pang={pang}
                pang2={pang2}
                pang3={pang3}
                pang4={pang4}
                setPang={setPang}
              />
            </div>
          }
        />
        <Route
          path="/detail/:id"
          element={
            <div>
              <Detail
                pang={pang}
                pang2={pang2}
                pang3={pang3}
                pang4={pang4}
                setPang={setPang}
                chief={chief}
              />
            </div>
          }
        />
        <Route
          path="/cart"
          element={
            <div>
              <Cart />
            </div>
          }
        />
        <Route
          path="*"
          element={
            <div className="page404">
              <h3>해당 페이지를 찾을 수 없습니다.</h3>
            </div>
          }
        />
      </Routes>
      <div className="event">
        <h2>진행중인 이벤트</h2>
        <img src={process.env.PUBLIC_URL + "/event.png"} />
      </div>
      <div>
        <ul>
          <li>
            <a href="/board/list.asp?board=notice&amp;uid=980">
              [중요] 성심당멤버십 앱 안내입니..
            </a>{" "}
            <span>2022-08-25</span>
          </li>
          <li>
            <a href="/board/list.asp?board=notice&amp;uid=979">
              KTX특송 배송제한 안내(광명역..
            </a>{" "}
            <span>2022-08-04</span>
          </li>
          <li>
            <a href="/board/list.asp?board=notice&amp;uid=978">
              코레일 수화물센터 파업으로 인한..
            </a>{" "}
            <span>2022-05-23</span>
          </li>
          <li>
            <a href="/board/list.asp?board=notice&amp;uid=977">
              ※ 안내 ※ 밀키트 가격 인상.
            </a>{" "}
            <span>2022-04-28</span>
          </li>
          <li>
            <a href="/board/list.asp?board=notice&amp;uid=976">
              하절기 배송(대전배송 및 KTX특..
            </a>{" "}
            <span>2022-04-25</span>
          </li>
          <li>
            <a href="/board/list.asp?board=notice&amp;uid=975">
              마산역 수화물센터 운영종료 및 ..
            </a>{" "}
            <span>2022-03-14</span>
          </li>
          <li>
            <a href="/board/list.asp?board=notice&amp;uid=974">
              KTX특송 이용 및 수화물센터 운..
            </a>{" "}
            <span>2022-02-10</span>
          </li>
          <li>
            <a href="/board/list.asp?board=notice&amp;uid=972">
              ★대전 내 배송시간 및 배송불가지..
            </a>{" "}
            <span>2022-02-10</span>
          </li>
        </ul>
      </div>
      <Footer />
    </div>
  );
}

export default App;
